import React from 'react';

function DBArticles(props) {
    let articles = [];
    console.log(props.articles);
    props.articles.forEach(article => {
        articles.push(

            <li key = {article._id } className="list-group-item">
                <h4>
                    <span>
                    <em>{article.title}</em>
                    </span>
                    <span className="btn-group pull-right">
                    <a href={article.url} target="_blank">
                        <button className="btn btn-default ">Visit IT</button>
                    </a>
                    <button className="btn btn-primary" onClick={() => props.handleDeleteButton(article._id)}>Delete IT</button>
                    </span>
                </h4>
                <p>Published at: {article.date}</p>
            </li>
        )
    })
    return (
        <div>
            {articles}
        </div>    
    )
}
export default DBArticles;
